import React from 'react';
import logo from './logo.svg';
import styles from './App.module.css';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import { HomePage, Register, SignIn ,Detail, Search, ShoppingCart} from './pages';
import { Redirect } from 'react-router-dom';

function App() {

  return (
    <div className={styles.App}>
     <BrowserRouter>
     <Switch>
      <Route path='/' exact component={HomePage}/>
      <Route path='/signin' exact component={SignIn}/>
      <Route path='/register' exact component={Register}/>
      <Route path='/detail/:touristRouteId' exact component={Detail}/>
      <Route path='/search/:keywords?' exact component={Search}/>
      <Route render={()=><h1>404 not found</h1>}></Route>
      </Switch>
     </BrowserRouter>
    </div>

  );
}

export default App;
